import React from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';

const Shelf = (props) => {
  return (
  //   <Card className='shelf'>
    <ul className='shelf'>
      {props.items && props.items.map((planogram) => (
        <Facing 
          upc={planogram.upc} 
          shelf={planogram.shelf}
          gondola={planogram.gondola}
        />
      ))}
      {/* <div className='shelf__description'>
        <h2>{props.shelf}</h2>
      </div> */}
    </ul>
  );
};

export default Shelf;
